import { Component } from '@angular/core';
import {MenuItem} from 'primeng/api';

@Component({
  selector: 'app-menu-bar',
  templateUrl: './menu-bar.component.html',
  styleUrls: ['./menu-bar.component.scss']
})
export class MenuBarComponent {

  menu: Array<MenuItem>=[
    {label: 'Home', icon: 'pi pi-home'},
    {label: 'Customer', icon: 'pi pi-user'},
    {label: 'Settings', icon: 'pi pi-cog'}

  ];


}
<h4 class="text-center mt-0">DashBoard</h4>

<div class="text-center">
    <p-avatar 
    image="https://user-images.githubusercontent.com/40702606/210880158-e7d698c2-b19a-4057-b415-09f48a746753.png"
    styleClass="mr-2"
    size="xlarge"></p-avatar>
</div>

<div>
    <app-menu-item *ngFor="let item of menu" [menuItem] = "item">
    </app-menu-item>
</div>
